import './App.css';
import {BrowserRouter as Router, Route, Routes} from 'react-router-dom'
import Home from './components/Home';
import Header from './components/Header';

function App() {
  return (
    <>
    <Router>
    <Header></Header>
    <Routes>
      <Route exact path="/" element={ <Home/> } />
      </Routes>

    </Router>
    </>

  );
}

export default App;
